import styled from 'styled-components'
import Pin from './Pin';

function Mainboard() {
    return (
        <Wrapper>
            <Container>
                <Pin />
            </Container>
        </Wrapper>
    )
}

export default Mainboard

const Wrapper = styled.div`
    background-color: white;
    display: flex;
    height: 100%;
    width: 100%;
    margin-top: 15px;
    justify-content:center;
`
const Container = styled.div`
    background-color: white;
    height: 400px;
    width: 80%;
`
